import React from "react";

type Props = {
  title: string;
  content: string;
};

export const Template = (props: Props) => {
  return (
    <div className=" w-[500px] h-[600px] font-serif  bg-white absolute inset-x-10 inset-y-[5%] rounded-sm py-5 px-8 flex flex-col text-[10px]">
      <img
        src="/assets/logoPoli.png"
        alt="psmza"
        className="w-[150px] mx-auto"
      />

      <div className="mt-5">
        <section className="uppercase font-bold text-center">
          <h1>
            LAPORAN {props.title}
          </h1>
          <h1>
            JABATAN TEKNOLOGI MAKLUMAT DAN KOMUNIKASI
          </h1>
          <h1>
            POLITEKNIK SULTAN MIZAN ZAINAL ABIDIN, DUNGUN TERENGGANU
          </h1>
        </section>

        <section className="mt-5">
            <h1 className="font-bold ">BUTIRAN PROGRAM</h1>
            <ol className=" list-decimal ml-5">
                <li>Nama Program: </li>
                <li>Penganjur: </li>
                <li>Tarikh: </li>
                <li>Tempat: </li>
            </ol>
        </section>

        <section className="mt-10">
          <p className=" indent-8">{props.content}</p>
        </section>
      </div>
    </div>
  );
};
